import { useState, useEffect } from "react";
import api from "../utils/api.js";
import { Link } from "react-router-dom";

function Profile() {
  const [user, setUser] = useState(null);
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const res = await api.get("/users/profile", {
          headers: { Authorization: `Bearer ${token} ` }
        });
        setUser(res.data);
      } catch (error) {
        console.error("Error fetching profile", error);
      }
    };
    fetchProfile();
  }, [token]);

  if (!user) return <p>Loading profile...</p>;

  return (
    <>
     <div className="flex justify-center items-center min-h-screen bg-gray-100">
      <div className="bg-white shadow-lg rounded-2xl p-6 w-full max-w-md">
        <h2 className="text-center text-2xl font-bold text-gray-800 mb-4">
          <i className="fa-solid fa-user mr-2"></i>Profile Details
        </h2>
        <hr className="mb-4" />

        <p className="text-lg mb-2"><b>Name:</b> {user.name}</p>
        <p className="text-lg mb-2"><b>Age:</b> {user.age || "Not set"}</p>
        <p className="text-lg mb-2"><b>Height:</b> {user.height ? `${user.height} cm` : "Not set"}</p>
        <p className="text-lg mb-2"><b>Weight:</b> {user.weight ? `${user.weight} kg` : "Not set"}</p>
        <p className="text-lg mb-4"><b>Gender:</b> {user.gender || "Not set"}</p>

        <p className="text-lg font-semibold mb-2">
          <i className="fa-solid fa-bullseye mr-2"></i>Goals:
        </p>
        {user.goal ? (
          <ul className="list-disc list-inside space-y-1 text-gray-700 mb-4">
            <li><i className="fa-solid fa-droplet text-blue-500 mr-2"></i>Water: {user.goal.water} glasses</li>
            <li><i className="fa-solid fa-shoe-prints text-green-600 mr-2"></i>Steps: {user.goal.steps} steps</li>
            <li><i className="fa-solid fa-bed text-purple-500 mr-2"></i>Sleep: {user.goal.sleep} hrs</li>
            <li><i className="fa-solid fa-fire text-orange-500 mr-2"></i>Calories: {user.goal.calories} kcal</li>
          </ul>
        ) : (
          <p className="text-gray-500 mb-4">Not set</p>
        )}

        <div className="space-y-3">
          <Link to="/profileform">
            <button className="w-full bg-green-600 hover:bg-green-700 text-white py-2 rounded-lg font-semibold">
              Update Profile
            </button>
          </Link>
          <Link to="/logout">
            <button className="w-full bg-red-600 hover:bg-red-700 text-white py-2 rounded-lg font-semibold">
              Logout
            </button>
          </Link>
        </div>
      </div>
    </div>
    </>
  );
}

export default Profile;
